(window.webpackJsonp=window.webpackJsonp||[]).push([[725],{1080:function(n,h,t){"use strict";t.r(h);var c=t(44),g=Object(c.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1627-danh-su-đuong-phan-boi-nhan-toc-【-canh-5-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1627-danh-su-đuong-phan-boi-nhan-toc-【-canh-5-】"}},[n._v("#")]),n._v(" Chương 1627: Danh Sư đường phản bội nhân tộc? 【 Canh [5] 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1627: Danh Sư đường phản bội nhân tộc? "),t("br"),t("br"),n._v("Bốn phía một hồi yên tĩnh."),t("br"),t("br"),n._v("Ngay cả trên không đang cùng Ngột Thần chiến đấu trắng nõn thanh niên, cũng bối rối, đình chỉ chiến đấu, nhìn lấy trên mặt đất nằm, bị một sách đập chết Dị Linh tộc nhân, nói không ra lời."),t("br"),t("br"),n._v("Vừa rồi bạo tăng mà lên khí tức, bọn họ đều cảm nhận được, một đầu hư hư thực thực Cổ Thánh gia hỏa, đương đại đỉnh phong nhất cường giả, vừa mới ra sân, chỉ nói cái “Rống dát”, còn chưa kịp đại triển hùng uy, liền lĩnh đơn giản..."),t("br"),t("br"),n._v("Cũng quá nghe rợn cả người đi."),t("br"),t("br"),n._v("Cổ Thánh, tung hoành thiên địa, mặc dù không nói vạn cổ bất diệt, nhưng cũng có thể làm được tích huyết trùng sinh, chỉ cần thọ nguyên không đến, hầu như có thể nói, căn bản giết không chết, bây giờ bị một quyển sách đập trúng đầu về sau, nguyên thần sụp đổ, mặt mũi khuất nhục, một tia khí tức đều không có..."),t("br"),t("br"),n._v("Đến cùng chuyện gì xảy ra?"),t("br"),t("br"),n._v("Lúc nào Cổ Thánh cũng cùng trứng gà đồng dạng, tùy tiện đụng một cái, liền bể nát?"),t("br"),t("br"),n._v("Quyển sách này đến cùng là cái gì?"),t("br"),t("br"),n._v("Cái tên này lại từ đâu bên trong làm ra?"),t("br"),t("br"),n._v("“Đi!”"),t("br"),t("br"),n._v("Vẻ mặt trắng bệch, trắng nõn thanh niên thân thể không ngừng run rẩy."),t("br"),t("br"),n._v("Cổ Thánh đều không chịu nổi một đòn, hắn tự nhiên lại càng không cần phải nói, tràn đầy kinh hoàng, cũng lại kìm nén không được, lần nữa xé ra một cái phù lục, không gian xuất hiện vết rách."),t("br"),t("br"),n._v("“Trốn chỗ nào...”"),t("br"),t("br"),n._v("Lông mày giương lên, Trương Huyền ngón tay một điểm, liền muốn đem không gian phong ấn."),t("br"),t("br"),n._v("“Để bọn hắn đi...”"),t("br"),t("br"),n._v("Còn không có điểm ra, một cái dồn dập truyền âm vang lên, Trương Huyền nhìn lại chỉ thấy Lạc Nhược Hi cau mày lắc đầu."),t("br"),t("br"),n._v("Nắm đấm xiết chặt, Trương Huyền cuối cùng vẫn thu hồi lực lượng."),t("br"),t("br"),n._v("Ông! Ông! Ông!"),t("br"),t("br"),n._v("Không khí chấn động, dường như trước đó trắng nõn thanh niên phối hợp mấy người cũng xé toang phù lục, biến mất tại nguyên chỗ, thời gian nháy mắt, toàn bộ thiên cơ sư công hội, chỉ còn lại có Tề Chân đám người."),t("br"),t("br"),n._v("“Vì cái gì?”"),t("br"),t("br"),n._v("Biết những người này chạy trốn, lại khó đuổi theo, hít sâu một hơi, Trương Huyền quay đầu nhìn về phía nữ hài."),t("br"),t("br"),n._v("Gấp gáp như vậy khuyên can, nhất định có nó mục đích."),t("br"),t("br"),n._v("“Bọn họ thật muốn chạy trốn, ngươi phong cấm không được!” Lạc Nhược Hi nhàn nhạt trả lời."),t("br"),t("br"),n._v("“Coi như phong cấm không được, ít nhất cũng có thể chém giết một vị...” Trương Huyền cắn răng."),t("br"),t("br"),n._v("Đối phương cũng là Cổ Thánh phía dưới sức chiến đấu mạnh nhất, tuy là có thể phong cấm không gian, nhưng lấy đối phương thủ đoạn cùng năng lực, phá vỡ sẽ không tiêu tốn quá nhiều thời gian, chạy trốn không thể tránh né, nhưng... Trước thời hạn có chuẩn bị, chỉ cần toàn lực chém giết, chơi chết một, hai cái, vẫn có niềm tin."),t("br"),t("br"),n._v("“Giết chết một cái, không quan trọng!” Lắc đầu, Lạc Nhược Hi vẻ mặt nghiêm túc: “Mặt khác... Vừa rồi nơi này, không chỉ một vị Cổ Thánh!”"),t("br"),t("br"),n._v("“Không chỉ một vị?”"),t("br"),t("br"),n._v("Trương Huyền sững sờ, đồng tử kìm lòng không được co rút lại: “Ngươi nói... Vừa rồi nơi này mai phục mấy vị Cổ Thánh?”"),t("br"),t("br"),n._v("“Ít nhất ba vị, có điều, nhìn thấy ngươi một sách đập chết một vị, biết không địch lại, xoay người rời đi... Nếu như cưỡng ép lưu lại bọn họ, ta sợ gây trở mặt... Liền xem như ngươi, chỉ sợ lại không đối kháng năng lực đi!”"),t("br"),t("br"),n._v("Lạc Nhược Hi nhìn qua."),t("br"),t("br"),n._v("“Ta...” Trương Huyền không cách nào trả lời."),t("br"),t("br"),n._v("Thiên đạo chi sách, chỉ có một bản, còn là vừa mới truyền thụ Lạc Huyền Thanh phong cấm không gian chân giải, nhận cảm kích, mới đến, thật muốn lại đến một vị Cổ Thánh, quả thực không có bất kỳ biện pháp nào."),t("br"),t("br"),n._v("Chỉ có bị động nhận lấy cái chết."),t("br"),t("br"),n._v("Nằm trên đất đầu này khổ cực Cổ Thánh, tuy là còn không có bày ra thực lực liền treo, nhưng vừa mới toả ra khí tức, tự mình cảm thụ, loại cường giả cấp bậc này, đối phó hắn, thậm chí không cần tự mình ra tay, chỉ bằng vào khí tức, liền có thể để hắn không cách nào chống lại, bị tại chỗ nghiền ép mà chết."),t("br"),n._v("Cổ Thánh... Không chỉ là nói một chút, nếu không có siêu tuyệt lực lượng, cũng không có khả năng, nắm giữ lực ảnh hưởng lớn như vậy cùng lực chấn nhiếp."),t("br"),t("br"),n._v("“Chỉ là...” Sau khi hết khiếp sợ, Trương Huyền tràn đầy không hiểu."),t("br"),t("br"),n._v("Cổ Thánh không phải đều rơi vào trạng thái ngủ say sao?"),t("br"),t("br"),n._v("Dị Linh tộc nhân, vì sao có thể đem Cổ Thánh phái tới nhiều như vậy, Danh Sư đường, đều không có chút nào phát giác?"),t("br"),t("br"),n._v("Dựa theo tình huống bình thường, đó căn bản là không thể nào sự tình!"),t("br"),t("br"),n._v("Trừ phi... Toàn bộ Danh Sư đường, đều làm phản rồi!"),t("br"),t("br"),n._v("“Hẳn là thiên cơ sư tổng bộ làm, bọn họ lợi dụng phương pháp đặc thù, che đậy thiên cơ, che đậy những này Cổ Thánh hành tung, cho dù là Danh Sư đường, đều không phát hiện ra được!”"),t("br"),t("br"),n._v("Nhìn ra trong lòng của hắn nghi ngờ, Ngột Thần đi tới trước mặt: “Hơn nữa, đem chỗ tuyển ở đây, cũng không tới gần Thánh tử điện, cũng không có mạnh mẽ Danh Sư đường, xuất hiện chút biến cố, cũng rất khó để cho người ta phát hiện!”"),t("br"),t("br"),n._v("Trương Huyền lặng im không nói."),t("br"),t("br"),n._v("Phong Cốc thành, dựa núi gần sông, ngũ cốc được mùa, nguyên nhân chính là như vậy, cùng Trương gia, Lạc gia đồng dạng, có thuộc về mình tổ chức... Nguyên nhân chính là như vậy, Danh Sư đường không tốt can dự, cho nên, cái thành phố này tuy là rất rộng rãi, nhưng không có Danh Sư đường phân bộ."),t("br"),t("br"),n._v("Bởi vậy, nơi này thật là thích hợp nhất chỗ."),t("br"),t("br"),n._v("“Cho dù có thiên cơ sư trợ giúp, có thể che lấp những này Dị Linh tộc nhân khí tức, nhưng... Dị Linh tộc tại Địa quật bên trong, muốn đi ra, nhất định phải đột phá Khưu Ngô Cổ Thánh lưu lại phong ấn... Mà mỗi cái Địa quật, đều có danh sư trấn thủ... Cũng không thể, cái này đều không biết từ đâu phát giác đi!” Trương Huyền nhìn tới."),t("br"),t("br"),n._v("“Ta đây cũng không biết, cùng tiểu thư, Trương sư rời đi về sau, ta cũng đang điều tra loại tình huống này, chỉ bất quá, không có bất kỳ cái gì manh mối...” Ngột Thần cau mày."),t("br"),t("br"),n._v("“Nói trắng ra là, không khó hiểu...” Lạc Nhược Hi nhìn qua: “Danh Sư đường, có người trợ giúp!”"),t("br"),t("br"),n._v("Trương Huyền thân thể chấn động."),t("br"),t("br"),n._v("Vừa rồi hắn cũng nghĩ đến, chỉ là không dám thừa nhận thôi."),t("br"),t("br"),n._v("Danh Sư đường, có thể làm được điểm này, tại trong đường, cũng nhất định có cực cao thân phận và địa vị!"),t("br"),t("br"),n._v("Đến cùng là ai?"),t("br"),t("br"),n._v("Tại sao muốn phản bội nhân tộc?"),t("br"),t("br"),n._v("“Lần này những này Dị Linh tộc nhân, tám chín phần mười là vì Ngoan Nhân xương ngực mà tới... Đối phương gấp gáp như vậy tìm kiếm xương ngực, không tiếc đi tới danh sư đại lục, chỉ sợ... Ngoan Nhân những bộ phận khác, đã bị tìm đầy đủ!”"),t("br"),t("br"),n._v("Sắc mặt nghiêm túc."),t("br"),t("br"),n._v("Ngoan Nhân, liền xem như trước kia Dị Linh tộc đỉnh phong nhất Hoàng giả một trong, cướp đoạt nó khung xương, cũng không cần Cổ Thánh đích thân tới!"),t("br"),t("br"),n._v("Huống chi, những này Cổ Thánh, giấu ở chỗ này, cùng trước đó mai phục đồng dạng, cho dù là hắn, cũng muốn không rõ ràng đến cùng chuyện gì xảy ra."),t("br"),t("br"),n._v("“Xem ra sau này liền Danh Sư đường cũng muốn cẩn thận một chút...”"),t("br"),t("br"),n._v("Vốn còn nghĩ, đem chuyện nơi đây, một năm một mười báo lên Danh Sư đường tổng bộ, có điều, hiện tại xem ra, còn là hơi trì hoãn thoáng cái."),t("br"),t("br"),n._v("Chưa hề đi qua Danh Sư đường tổng bộ, không biết đến cùng ai là người tốt, ai là kẻ xấu, ngộ nhỡ, tin tức không có truyền lại tốt, chân chính danh sư không có nhận đến, ngược lại truyền đến gian tế trong tay... Toàn bộ nhân tộc, tất nhiên sẽ đối mặt càng lớn tai nạn."),t("br"),t("br"),n._v("Cho nên, thế cục bây giờ bên dưới, tất cả đều muốn cẩn thận."),t("br"),t("br"),n._v("“Nhìn tới, Danh Sư đường cũng không đáng tin cậy, nhất định phải nhanh chỉnh hợp trong tay tài nguyên, Trương gia, Lạc gia, Thánh tử điện, Chiến Sư đường... Nếu không, Dị Linh tộc nhân thật toàn diện xâm lấn, ai cũng chống lại không được!”"),t("br"),t("br"),n._v("Vẻ mặt khó coi."),t("br"),t("br"),n._v("Danh Sư đường tổng bộ xảy ra vấn đề, để cho người ta không kịp chuẩn bị, hiện tại tình hình nguy cơ, dựa vào ai cũng không bằng dựa vào chính mình, chỉ có thể nghĩ biện pháp đem đã có lực lượng chỉnh hợp, hi vọng Dị Linh tộc nhân không có xâm lấn nhanh như vậy."),t("br"),t("br"),n._v("“Trương Huyền, Cổ Thánh một thân là bảo, đầu này đại gia hỏa, mặc dù chỉ là vừa mới bước vào cấp bậc này, thuộc về cấp thấp nhất, thi thể nhưng cũng là một cái bảo tàng khổng lồ!”"),t("br"),t("br"),n._v("Thấy hắn suy nghĩ, Lạc Nhược Hi nói: “Ngươi có muốn hay không?”"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1638"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1640"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);